Cette fois ci, on troque le bubble tea pour du bon café et breuvages chauds servis dans un food truck à l’entrée! L’ambiance automnale se transforme en ambiance des fêtes! Viens prendre ta photo dans notre beau photobooth et admire le décor hivernal de la ferme. Profites-en pour savourer nos délicieux biscuits de pain d’épices gratuits! 

Les 100 premiers arrivés auront un beau sac cadeau rempli de petits trésors d’ici! 

